// the long list of cryptocoins

import React from "react";
import CoinItem from "./CoinItem";
import { Link } from 'react-router-dom';
import Coin from "../routes/Coin";

const Coins = (props) => {
    return (
        <div>
            <div className="bg-zinc-900 rounded-xl">
                <div className='flex justify-between items-center font-bold py-5'>
                    <p className="items-center ml-6">Rank</p>
                    <p className="items-center mx-2">Coin</p>
                    <p className="items-center mx-2">Price</p>
                    <p className="items-center mx-2">24h</p>
                    <p className='items-center mx-2'>Volume</p>
                    <p className='items-center mr-6'>Mkt Cap</p>
                </div>

                {props.coins.map((coins) => {
                    return (
                        <Link to={`/Coin/${coins.id}`} element={<Coin />} key={coins.id}>
                            <CoinItem coins={coins}/>                    
                        </Link>                        
                    )
                })}

            </div>
        </div>
    );
}

export default Coins;
